import React, { useEffect } from "react";

export default function Read({users}){
    const afficher=()=>{
        console.log("hhhh", users.id);
    }
    useEffect(() => {
        
        return () => {
            afficher()
        };
    }, []);
  return(
    <>
    <h1>hellow read</h1>
    <table class="table">
        <thead>
            <tr>
                <th>id</th>
                <th>fullname</th>
                <th>country</th>
            </tr>
        </thead>
        <tbody>
        {users.length>0? users.map((user,key)=>(
 <tr key={key}>
 <td scope="row">{user.id}</td>
 <td>{user.fullname}</td>
 <td>{user.country}</td>
</tr>
        )):<h1>no users</h1>}
           
          
        </tbody>
    </table>
    </>
  )
};
